\r

\r
## Contact\r

\r
**By using [PRODUCT_NAME], you agree to comply with this Acceptable Use Policy.**\r
`,rz=`# DMCA Copyright Policy\r
_Last updated: [LAST_UPDATED]_\r
\r
**[COMPANY_NAME]** respects intellectual property rights and responds to notices of alleged copyright infringement in accordance with the Digital Millennium Copyright Act ("DMCA").\r
\r
## Reporting Copyright Infringement\r
\r
If you believe content on **[PRODUCT_NAME]** infringes your copyright, send a DMCA notice to:\r
\r
**DMCA Agent**\r
**[COMPANY_NAME]**\r
**[COMPANY_ADDRESS]**\r
Email: **[CONTACT_EMAIL]**\r
\r
## Required Information\r
\r
Your notice must include:\r
\r
1. **Physical or electronic signature** of the copyright owner or authorized representative\r
2. **Identification of the copyrighted work** claimed to have been infringed\r
3. **Identification of the infringing material** with sufficient detail to locate it (URLs preferred)\r
4. **Your contact information**: name, address, telephone number, email\r
5. **A statement** that you have a good faith belief that use of the material is not authorized\r
6. **A statement** made under penalty of perjury that the information is accurate and you are authorized to act on behalf of the copyright owner\r
\r
## Counter-Notice\r
\r
If you believe content was removed in error, you may submit a counter-notice including:\r
\r
1. **Your physical or electronic signature**\r
2. **Identification of removed material** and its prior location\r
3. **A statement under penalty of perjury** that you have a good faith belief material was removed by mistake or misidentification\r
4. **Your contact information**: name, address, telephone\r
5. **Statement of consent** to jurisdiction in your location or where [COMPANY_NAME] is located\r
\r
## Process\r
\r
1. Upon receiving a valid DMCA notice, we will:\r
   - Remove or disable access to the allegedly infringing material\r
   - Notify the user who posted the content\r
   - Document the complaint\r
\r
2. Upon receiving a valid counter-notice, we will:\r
   - Forward it to the original complainant\r
   - Restore content in 10-14 business days unless complainant files legal action\r
\r
## Repeat Infringer Policy\r
\r
We will terminate accounts of users who are repeat infringers in appropriate circumstances.\r
\r
## False Claims\r
\r
Making false DMCA claims may result in:\r
- Liability for damages under Section 512(f)\r
- Legal action\r
- Account termination\r
\r
## Good Faith\r
\r
We act in good faith when processing DMCA notices and are not liable for removing allegedly infringing content in response to valid notices.\r
\r
## Contact\r
\r
For DMCA-related questions: **[CONTACT_EMAIL]**\r
\r
**Note**: This process applies only to copyright infringement claims under the DMCA. For other issues (trademark, privacy, terms violations), use our standard reporting procedures.\r
`,nz=`# Data Processing Agreement (DPA)\r
_Effective Date: [LAST_UPDATED]_\r
\r
This Data Processing Agreement ("DPA") forms part of the Terms of Service between **[COMPANY_NAME]** ("Processor") and the Customer ("Controller") for the provision of **[PRODUCT_NAME]** services.\r
\r
## 1. Definitions\r
\r
- **Personal Data**: Any information relating to an identified or identifiable natural person processed through the Service\r
- **Processing**: Any operation performed on Personal Data\r
- **Data Subject**: The individual whose Personal Data is processed\r
- **GDPR**: General Data Protection Regulation (EU) 2016/679\r
\r
## 2. Scope and Role of Parties\r
\r
**Controller** determines the purposes and means of processing Personal Data.\r
\r
**Processor** ([COMPANY_NAME]) processes Personal Data on behalf of Controller in accordance with Controller's documented instructions.\r
\r
## 3. Processor's Obligations\r
\r
### 3.1 Processing Instructions\r
Processor shall process Personal Data only:\r
- On documented instructions from Controller\r
- As necessary to provide the Service\r
- As required by applicable law\r
\r
### 3.2 Confidentiality\r
Processor ensures that persons authorized to process Personal Data:\r
- Are bound by confidentiality obligations\r
- Receive appropriate training on data protection\r
\r
### 3.3 Security Measures\r
Processor implements appropriate technical and organizational measures including:\r
- Encryption of Personal Data in transit (TLS 1.2+)\r
- Encryption of Personal Data at rest\r
- Regular security assessments and testing\r
- Access controls and authentication\r
- Incident response procedures\r
- Regular backups\r
\r
### 3.4 Sub-processors\r
Processor may engage sub-processors to process Personal Data, subject to:\r
- Prior written notice to Controller\r
- Controller's right to object within 30 days\r
- Written contract imposing same obligations as this DPA\r
- Current list available at: **[PROCESSORS_URL]**\r
\r
### 3.5 Data Subject Rights\r
Processor shall assist Controller in responding to Data Subject requests:\r
- Access to Personal Data\r
- Rectification of inaccurate data\r
- Erasure ("right to be forgotten")\r
- Restriction of processing\r
- Data portability\r
- Objection to processing\r
\r
Response time: Within 72 hours of Controller's request\r
\r
### 3.6 Data Breach Notification\r
In case of a Personal Data breach, Processor shall:\r
- Notify Controller within **[IR_TRIAGE_HOURS]** hours\r
- Provide available information about the breach\r
- Cooperate with Controller's investigation\r
- Implement measures to mitigate harm\r
\r
## 4. International Data Transfers\r
\r
Where Personal Data is transferred outside the EEA/UK, Processor ensures:\r
- Adequate level of protection (e.g., EU-US Data Privacy Framework)\r
- Standard Contractual Clauses (SCCs) are in place\r
- Other appropriate safeguards as required by GDPR\r
\r
Transfer mechanisms available upon request to: **[CONTACT_EMAIL]**\r
\r
## 5. Data Retention and Deletion\r
\r
### 5.1 Retention Period\r
Personal Data is retained for: **[RETENTION_SUMMARY]**\r
\r
### 5.2 Deletion\r
Upon termination or Controller's request, Processor shall:\r
- Delete or return all Personal Data\r
- Delete existing copies (unless legal retention required)\r
- Certify deletion upon request\r
- Complete deletion within **[ANONYMIZATION_DELAY]**\r
\r
## 6. Audit Rights\r
\r
Controller may audit Processor's compliance:\r
- Annual audit rights\r
- Additional audits if data breach occurs\r
- 30 days' advance notice required\r
- During business hours\r
- Reasonable costs borne by Controller\r
\r
Controller may request:\r
- SOC 2 Type II reports\r
- ISO 27001 certificates\r
- Security documentation\r
- Pen test results (redacted as appropriate)\r
\r
## 7. Controller's Obligations\r
\r
Controller warrants that:\r
- It has lawful basis for processing\r
- It has provided necessary privacy notices to Data Subjects\r
- Processing instructions comply with applicable law\r
- It will not instruct Processor to violate data protection law\r
\r
## 8. Liability and Indemnification\r
\r
Each party is liable for damages caused by its breach of this DPA, in accordance with GDPR Articles 82-84.\r
\r
## 9. Term and Termination\r
\r
This DPA:\r
- Begins on the Effective Date\r
- Continues for the duration of the Service agreement\r
- Survives termination with respect to data deletion obligations\r
\r
## 10. Changes to this DPA\r
\r
Processor may update this DPA to:\r
- Reflect changes in data protection law\r
- Implement new security measures\r
- Add sub-processors (with notice)\r
\r
Material changes require 30 days' notice.\r
\r
## 11. Governing Law\r
\r
This DPA is governed by the laws of **[GOVERNING_LAW]**.\r
\r
Disputes shall be resolved in **[VENUE]**.\r
\r
## 12. Contact Information\r
\r
**Data Protection Officer**\r
**[COMPANY_NAME]**\r
Email: **[DPO_EMAIL]**\r
Address: **[COMPANY_ADDRESS]**\r
\r
For DPA-related questions: **[CONTACT_EMAIL]**\r
\r
---\r
\r
**By using [PRODUCT_NAME], Controller agrees to this Data Processing Agreement.**\r
